import {Text, View} from 'react-native';
import {Box, HStack, Pressable, Center, Container} from 'native-base';

function TitleBar(){

    return(
        <Container>
        <Text style={styles.titleText}>Homepage</Text>
        </Container>
    );
}

const styles = StyleSheet.create({
    titleText: {
      fontSize: 20,
      fontWeight: "bold"
    }
  });

export default TitleBar;
